description:
Lesbian Office Seductions 7 (Nica Noelle, Sweetheart Video / WebDl / 2012)

Nica Noelle returns full-force with her tales of office intrigue in a female-dominated world with the 7th volume of Lesbian Office Seductions. Bringing together such big names as Dana Vespoli, Sinn Sage, Katie St. Ives and Katsuni, these girls get embroiled in steamy tales of forbidden romance and secret office trysts. This movie combines Sweetheart's famous commitment to real passion and authentic sex, and is all shot in amazing high quality HD picture. Written and directed by Nica Noelle.

Sinn Sage, Katie St. Ives, Dana Vespoli, Sovereign Syre, Angell Summers, Katsuni, Ryan Keely

All Girl / Lesbian, All Sex

